import React from 'react';
import './Campaigns.css';

const CampaignPage = () => {
  return (
    <div className="campaign-container">
      <h1>Blood Donation Campaigns</h1>
      <p className="campaign-description">
        This is some text for the campaign. It provides information about the campaign and its objectives.
      </p>
      <div className="image-section">
        <img src="/images/img-11.png" alt="Campaign 1" />
        <img src="/images/img-11.png" alt="Campaign 2" />
        <img src="/images/img-11.png" alt="Campaign 3" />
      </div>
    </div>
  );
};

export default CampaignPage;
